webpackJsonp([0xfa3977734f15],{1455:function(a,e){a.exports={data:{markdownRemark:{html:"<p>中国における腐敗の状態に関するセクションを書く。データをうまくチェックするために、いくつかの新しい概念があります。現在のコンセプトのほとんどは、1990年に出版された「反汚職：中国での実験」という本の中から新しい概念を追加する準備が整いました。増加することが決定された核心概念は、中国における腐敗活動の発展傾向は以下の通りである：</p>\n<p>少量の破損から大量の破損まで。数量面では、現在の腐敗行為の数はますます増えており、数千万元の腐敗取引が頻繁に発生しており、過去数年間では数は比較的少なく、数十万元はすでに不幸なケースです。その時、張清山と他の人たちはさらに悲しんでいた。このような傾向の下で、腐敗した活動は社会開発に多大なダメージを与えているため、これは注目すべき傾向です。低レベルの破損から高レベルの破損まで。過去のより多くの腐敗</p>\n<p>幹部レベルの幹部に焦点を当てると、高位の幹部の腐敗活動の数は増加しているが、低位の幹部の数も増えているが、上位幹部の腐敗活動は草の根の幹部より社会への影響が大きい。その影響ははるかに大きい。</p>\n<p>低品質の破損から高品質の破損まで。技術的な観点から言えば、自然を指しています。腐敗は、腐敗や贈収賄、あるいは搾取、技術的に浅く、ハイテクな手段に集中していることが判明しています。現在のコンピュータの使用と腐敗のための洗練された手段は劇的に増加している。これは、腐敗技術そのものの発展や腐敗防止の圧力の下での対策の必要性に関連する。</p>\n<p>浅い腐敗から深い腐敗まで。深刻な腐敗は、政界における腐敗を意味する。腐敗活動は現在、選挙や公職を求めて増加している。この腐敗は深刻な腐敗であり、権力機構や自然の腐食であり、特に注目すべきである。</p>",id:"/home/swain/workspace/political-life/src/pages/ja/0106.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0106.md",frontmatter:{title:"6月5日 日曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0106.md absPath of file >>> MarkdownRemark"}}}});
